Hľadáte darček na Vianoce pre blízkych? 🎁

@collalloc pripravil vianočné balenie 

V balení nájdete trojmesačnú kúru collalloc a jeden vitamín C, čo ideálny doplnok k kolagénu 🤍

Moje rána rada trávim aktívne a s pohybom, no niekedy sú náročné. 

Môj ranný rituál je káva od @hellenergysk ☕️ Odporúčam ochutnať hlavne príchuť Salted Caramel - je to namotávka 😋

